import React from "react";

const initiialState = {
  mount: false,
  count: 0,
};

export const Body = function () {
  const [state, setState] = React.useState(initiialState);
  const onBtnClick = () => {
    setTimeout(()=>{
        setState({
            ...state,
            mount: !state.mount,
            count: state.count + 1,
          });
    }, 2000);

  };
  return state.mount === true ? (
    <div>Loading...</div>
  ) : (
    <div className="body-container">
      <p>{`mount -${state.mount}`}</p>
      <p>{`count - ${state.count}`}</p>
      <button onClick={onBtnClick}>Click Me</button>
    </div>
  );
};
